#include "TXLib.h"

void okno()
{
   txSetColor (TX_BLACK);
   txSetFillColor(TX_BLUE);
   txRectangle(190,220,240,300);
}

void cloud (int x)
{
    txSetColor (TX_BLACK);
    txSetFillColor(TX_WHITE);
    txEllipse(x,30,x+200,120);
}




void drer()
{
    txSetColor (TX_BLACK);
    txSetFillColor(RGB(139,85,58));
    txRectangle(260,280,330,420);
}

void Fon()
{
    txSetColor (TX_BLACK);
    txSetFillColor(RGB(58,248,234));
    txRectangle(0,0,800, 600);
}

void Fon1()
{
    txSetColor (TX_BLACK);
    txSetFillColor(RGB(62,28,77));
    txRectangle(0,0,800, 600);
}
void Fon2()
{
    txSetColor (TX_BLACK);
    txSetFillColor(TX_BLACK);
    txRectangle(0,0,800, 600);
}
void travka ()
{
    txSetColor (TX_GREEN);
    txSetFillColor (TX_GREEN);
    txRectangle(0, 420, 800, 600);
}
void dom ()
{
    txSetColor (TX_BLACK);
    txSetFillColor (TX_RED);
    txRectangle (160, 120, 380, 420);
    POINT tri[3] = {{160, 120}, {270, 10}, {380,120}};
    txPolygon (tri, 3);
}
void luna (int x)
{
    txSetColor (TX_BLACK);
    txSetFillColor (TX_WHITE);
    txCircle(x,40,50);
}
void conce(int x)
{
    txSetColor (TX_BLACK);
    txSetFillColor (RGB(231,254,18));
    txCircle(x,40,50);
}

